  function showBanner(message, isError) {
  const banner = document.createElement("div");
  banner.textContent = message;
  banner.style.position = "fixed";
  banner.style.bottom = "10px";
  banner.style.right = "10px";
  banner.style.padding = "10px";
  banner.style.backgroundColor = "#000";
  banner.style.color = "#fff";
  banner.style.borderRadius = "5px";
  banner.style.zIndex = "9999";
  banner.classList.add('banner');
  if (isError) {
  banner.style.backgroundColor = "red";
  }
  document.body.appendChild(banner);
  setTimeout(() => {
    banner.remove();
  }, 3000);
}

const addMovie = async (tmdbId, title) => {
  try {
    const response = await fetch(`${radarrUrl}?apikey=${apiKey}`, {
      method: "POST",
      headers: {
        "Content-Type": "application/json"
      },
      body: JSON.stringify({

          "tmdbId": tmdbId,
          "title": title,
          "qualityProfileId": 1,
          "rootFolderPath": "", // YOUR ROOTFOLDERPATH
          "monitored": true,
          "addOptions": {
            "searchForMovie": true
          }
      })
    });
    if (response.ok) {
      showBanner(`${title} added to Radarr!`);
    } else {
      showBanner(`Error adding ${title} to Radarr: ${response.statusText}`, true);
    }
  } catch (error) {
    console.error(`Error adding ${title} to Radarr: ${error.message}`);
  }
}

  // Function used to build icons
function createIcon(cont, title, href, icon) {
      if (cont.querySelector('.radarr-icon')) {
    return;
  }
  var a = document.createElement('a');
  a.href = href;
  a.title = title;
  a.setAttribute('target', '_blank');

  var img = document.createElement('img');
  img.src = icon;
  img.setAttribute('height', '23em');
  img.setAttribute('width', '23em');
  a.appendChild(img);

  var span = document.createElement('span');
  span.classList.add('radarr-icon'); // Add class to identify icon
  span.appendChild(a);
  cont.appendChild(span);
  console.log(title, 'icon built successfully.');
}

        //Get TMDB ID from title with TMDB API
function getTmdbId(filmTitle, filmYear) {
  const api_key = ''; // YOUR TMDB API KEY
  const url = `https://api.themoviedb.org/3/search/movie?api_key=${api_key}&query=${filmTitle}&year=${filmYear}`;
  return fetch(url)
    .then(response => response.json())
    .then(data => {
      if (data.total_results > 0) {
        return data.results[0].id;
      } else {
        throw new Error(`No movie was found with the title "${filmTitle}" and release year "${filmYear}".`);
      }
    })
    .catch(error => {
      throw error;
    });
}

